  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0114997 includes biological,
  chemical, discrete sample, physical and profile data collected from NOAA Ship MALCOLM
  BALDRIGE in the North Atlantic Ocean and South Atlantic Ocean from 1993-07-04 to
  1993-08-30 and retrieved during cruise OACES93. These data include ALKALINITY, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), CHLOROPHYLL A, DELTA CARBON-13, DELTA
  CARBON-14, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE,
  NITRITE, PHAEOPHYTIN, PHOSPHATE, Partial pressure (or fugacity) of carbon dioxide,
  Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE and pH. The
  instruments used to collect these data include CTD and bottle. These data were collected
  by Rik Wanninkhof of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological
  Laboratory and John L. Bullister of US DOC; NOAA; OAR; Pacific Marine Environmental
  Laboratory as part of the OACES93_A16N data set.nnThe World Ocean Circulation Experiment
  (WOCE) was a major component of the World Climate Research Program with the overall
  goal of better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
